window.bookSummaryJSON = "<p>Vivia Montavio is a traitor, and it’s my job to see to her punishment and interrogation.</p> <p>What a tragedy.</p> <p>She’s the hottest little number I’ve ever seen, with that defiant little chin and eyes that spark with wit and boldness. I love a good challenge.<br> <br> We’re left with little choice when the truth comes outs.<br> So I take her far, far away to <i>La Cabina, </i>a rustic cabin in the middle of nowhere.<br> To…interrogate her.<br> Discover the truth.</p> <p>But when I uncover more than I anticipated, she’s not the only guilty one.<br> Because now that we’re alone, I’ll take whatever I want.<br> The truth.<br> Her innocence.</p> <p><i>Everything.</i></p> <p>She’s in danger, but there’s only one way to protect her now:<br> Claim her as mine.<br> Keep her captive.</p> <p><i>Possess her.</i></p> <p>And there’s no one left to protect her from me.</p>"; 
